import React, {Component} from "react";
import '../tabata.css';
import Form from 'react-bootstrap/Form'

class Exercise extends Component {
    render() {
        return(
                <div className="text-center">
                    <h1>Tu Tabata</h1>
                    <div className="card-body">
                       <div class="form-group col-3">
                           <label for="exampleFormControlSelect2">Vueltas</label>
                           <select multiple class="form-control form-control-sm" id="exampleFormControlSelect2">
                             <option>1</option>
                             <option>2</option>
                             <option>3</option>
                             <option>4</option>
                             <option>5</option>
                           </select>
                         </div>

                    </div>
                    <div className="card-body">
                        <h4 className="card-title">Tiempo de descanso:</h4><p>60seg</p>
                        <h4 className="card-title">Tiempo de espera:</h4><p>10seg</p>
                    </div>
                </div>
        );
    }
}

export default Exercise;
